function Download_page() {
    return (
        <section className="page-section bg-dark text-white">
            <div className="container px-4 px-lg-5 text-center">
                <h2 className="mb-4">Free Download at App Store!</h2>
                <a className="btn btn-light btn-xl" href="https://startbootstrap.com/theme/creative/">무료로 체험해 보세요!</a>
            </div>
        </section>
    );
}

export default Download_page;
